import React from "react";
import 'antd/dist/antd.css';

import { Layout, Typography, Space, Card, Menu, Button } from 'antd';
import {
  AppstoreOutlined,
  MenuUnfoldOutlined,
  MenuFoldOutlined,
  PieChartOutlined,
  DesktopOutlined,
  ContainerOutlined,
  MailOutlined,
} from '@ant-design/icons';

const { SubMenu } = Menu;

const { Header, Footer, Sider, Content } = Layout;

const { Title } = Typography;

function App() {
  return (
    <div className="App">

      <Layout>
        <Sider style={{ background: '#8CFFCD' }}><Title level={2}>Pokes</Title></Sider>
        <Layout>
          <Header style={{ background: '#FFA59B' }}><Title>Reyes Rojas Mauricio</Title></Header>
          <Content><Space direction="vertical">
            <Card title="Card" style={{ width: 300 }}>
              <p>Card content</p>
              <p>Card content</p>
            </Card>
            <Card title="Card" style={{ width: 300 }}>
              <p>Card content</p>
              <p>Card content</p>
            </Card>
          </Space></Content>
          <Footer style={{ background: '#FFA59B' }}><Title level={3}>Derechos ReservadosÂ©</Title></Footer>
        </Layout>
      </Layout>

    </div>

  );
}
export default App;
